// winner.js
document.addEventListener('DOMContentLoaded', () => {
    const winnerImage = document.getElementById('winnerImage');
    const winnerMessage = document.getElementById('winnerMessage');
    const playAgainButton = document.getElementById('playAgainButton');

    // Array of objects, each representing a pair of picture and message
    const winnersData = [
        //{ photo: 'pic/pic1.jpg', message: 'message 1' },
        //{ photo: 'pic/pic2.jpg', message: 'massege 2' },
        //{ photo: 'pic/pic3.jpg', message: 'massege 3' },
        //{ photo: 'pic/pic4.jpg', message: 'massege 4' },
        //{ photo: 'pic/pic5.jpg', message: 'massege 5' },
        //{ photo: 'pic/pic6.jpg', message: 'massege 6' },
        //{ photo: 'pic/pic7.jpg', message: 'massege 7' },
        //{ photo: 'pic/pic8.jpg', message: 'massege 8' },
        //{ photo: 'pic/pic9.jpg', message: 'massege 9' },
        //{ photo: 'pic/pic10.jpg', message: 'massege 10' },
        //{ photo: 'pic/pic11.jpg', message: 'massege 11' },
        
        
        { photo: 'data:image/jpeg;base64,', message: 'massege 11' },
        // Add more pairs as needed
    ];

    // Select a random pair
    const randomIndex = Math.floor(Math.random() * winnersData.length);
    const randomWinner = winnersData[randomIndex];

    // Display the random photo and message
    winnerImage.src = randomWinner.photo;
    winnerMessage.textContent = randomWinner.message;

    // Add event listener for the "Play Again" button
    playAgainButton.addEventListener('click', () => {
        window.location.href = 'index.html';
    });
});
